import React, { useEffect, useState } from 'react';
import Card from "./Card";

const Home = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('https://script.google.com/macros/s/AKfycbzAk3DWTrYtZwCKKtrGhAtc1Au70cV_bxIoTMv8JbK_mv6lFH1ZUPPcJymtE6F8KjJF/exec')
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => setData(data.data.json))
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);

    return (
        <div className="home">
            <div className="section">
                <h1>Top Reviews</h1>
                <div className="gallery">
                    {data.map((i, index) => (
                        <Card props={i} key={index} />
                    ))}
                </div>
            </div>
            <hr />
        </div>
    );
}

export default Home;
